if ( msg.action == "dotmatrix") {
    /*
     * 16px by 16px, column major, big endian. @ http://dotmatrixtool.com 
     */
    var uint_8 = 
        [
            0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, // spacer 

            0xf8, 0x00, 0x40, 0x00, 0x20, 0x00, 0xf8, 0x00, // NODE
            0x00, 0x00, 0x70, 0x00, 0x88, 0x00, 0x70, 0x00, 
            0x00, 0x00, 0xf8, 0x00, 0x88, 0x00, 0x70, 0x00, 
            0x00, 0x00, 0xf8, 0x00, 0xa8, 0x00, 0x88, 0x00, 

            0x00, 0x00, 0x20, 0x00, 0x20, 0x00, 0x20, 0x00, // minus
            0x00, 0x00,

            0xf8, 0x00, 0xa0, 0x00, 0x58, 0x00, 0x00, 0x00, // RED!
            0xf8, 0x00, 0xa8, 0x00, 0x88, 0x00, 0x00, 0x00, 
            0xf8, 0x00, 0x88, 0x00, 0x70, 0x00, 0x00, 0x00, 
            0xe8, 0x00, 

            0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, // spacer
        ];

    var binaryData = uint_8.map((d) => { return ("000000000" + d.toString(2)).slice(-8) })

    var cidx = ((msg.column % (uint_8.length/2))*2) + (msg.row > 7 ? 1 : 0);
    var ridx = msg.row % 8;

    if ( !this.context.get("myrow") ) { this.context.set("myrow", msg.row) }
    if (!this.context.get("mycolumn")) { this.context.set("mycolumn", msg.column)}

    var myColumn = this.context.get("mycolumn")
    var myRow = this.context.get("myrow")

    setTimeout(() => {
        node.status({
            fill: binaryData[cidx][ridx] == "1" ? "red" : "grey",
            shape: "dot",
            text: msg.verbose ? "c" + myColumn + "r" + myRow : ""
        })
    }, 250);

    msg.rowdata.push({
        col: myColumn, 
        row: myRow,
        val: binaryData[cidx][ridx] == "1"
    })
}

msg.column += 1;

if (!this.context.get("stop") && msg.action == "stop") {
    this.context.set("stop", true);

    node.status({fill: "green", shape: "dot", text: "stopping"})

    var ctxt = this.context;
    setTimeout( () => {
        node.status({});
        ctxt.set("stop", false)
        ctxt.set("mycolumn", false)
        ctxt.set("myrow", false)
    },2000);

    return msg;
}

if ( !this.context.get("stop") ) {
    return msg;
}

/* How big should the display be? */
const nrCols = msg.nrCols;
const nrRows = msg.nrRows;

/*
  Matrial ids: these are taken from using "Export Nodes" and reading the json generated.
*/
var materials = [
    [
        "17350478e877bc09", // red
        "e7298bcff0d93b16", // white
    ],
    [
        "e7298bcff0d93b16", // white
        "17350478e877bc09", // red
    ],
]

var junctionToAll = {
    "id": RED.util.generateId(),
    "type": "junction",
    "x": 0,
    "y": 0,
    "wires": [
        [
        ]
    ]
}

var colRouter = {
    "id": RED.util.generateId(),
    "type": "switch",
    "name": "col switch",
    "property": "col",
    "propertyType": "msg",
    "rules": Array.from({ length: nrCols }, () => { return { "t": "eq", "v": "1", "vt": "num" }}),
    "checkall": "false",
    "repair": false,
    "outputs": nrCols,
    "x": 0,
    "y": -600,
    "wires": Array.from({ length: nrCols }, () => { return []}),
}

// set correct values
colRouter.rules.forEach((i, d) => i.v = (d + 1).toString())

var rowRouters = [];
for ( var y = 0; y < nrCols; y++) {
    var rowRouter = {
        "id": RED.util.generateId(),
        "type": "switch",
        "name": "row switch for col " + (y+1),
        "property": "row",
        "propertyType": "msg",
        "rules": Array.from({ length: nrRows }, () => { return { "t": "eq", "v": "1", "vt": "num" }}),
        "checkall": "false",
        "repair": false,
        "outputs": nrRows,
        "x": 200*y,
        "y": -500,  
        "wires": Array.from({ length: nrRows }, () => { return []})
    }

    colRouter.wires[y].push(rowRouter.id)
    rowRouter.rules.forEach((i, d) => i.v = (d + 1).toString())
    rowRouters.push(rowRouter)
}

var valueScaler = {
    "id": "WILLBEPREPLACDE",
    "type": "change",
    "name": "Set Z scale",
    "rules": [
        {
            "t": "set",
            "p": "payload",
            "pt": "msg",
            "to": "{\t    \"type\": \"scale\",\t    \"relative\": false,\t    \"values\": {\t      \"x\":1,\t      \"y\":1,\t      \"z\":$$.payload\t    },\t    \"pivot\": {\t        \"x\": null,\t        \"y\": null,\t        \"z\": null\t    }\t}",
            "tot": "jsonata"
        }
    ],
    "action": "",
    "property": "",
    "from": "",
    "to": "",
    "reg": false,
    "x": 0,
    "y": 0,
    "wires": [
        [

        ]
    ]
}

var baseNode = {
    "id": "WILLBEREPLACED",
    "type": "box",
    "scene": "c0d1433da002f3c6",
    "material": "WILLBEREPLACED",
    "name_conf_a": "WILLBEREPLACED",
    "size_conf_n": 1,
    "height_conf_n": "",
    "width_conf_n": "",
    "depth_conf_n": "",
    "updatable_conf_b": false,
    "sideOrientation_conf_a": "1",
    "pos_x": "WILLBEREPLACED",
    "pos_y": "WILLBEREPLACD",
    "pos_z": 0,
    "scale_x": "1",
    "scale_y": "1",
    "scale_z": "0.25",
    "rot_x": 0,
    "rot_y": 0,
    "rot_z": 0,
    "x": 0,
    "y": 0,
    "wires": [
        []
    ]
}
var nodes = []

for (var x = 1; x < (nrCols + 1); x++) {
    for (var y = 1; y < (nrRows + 1); y++) {
        var nde = { ...baseNode };
        nde.x = 180 * x;
        nde.y = (60 * nrRows) + (50 * y);
        nde["name_conf_a"] = "pixel_" + x + "_x_" + y
        nde.pos_x = x;
        nde.pos_y = (nrRows - y) + 1;
        nde.material = materials[x % 2][y % 2]
        nde.id = RED.util.generateId()

        var scaler = { ...valueScaler }
        scaler.id = RED.util.generateId()
        scaler.x = 180 * x;
        scaler.y = 50 * y;
        scaler.wires = [[nde.id]]

        rowRouters[x-1].wires[y-1].push(scaler.id)
        junctionToAll.wires[0].push(nde.id)

        nodes.push(scaler)
        nodes.push(nde)
    }
}

var ary = [
    junctionToAll,
    colRouter
];

// @ts-ignore
msg.payload = nodes.concat(ary).concat(rowRouters);

return msg;

for ( var x = 1 ; x < 20 ; x++ ){
    for ( var y = 1; y < 20 ; y++ ) {
        node.send({
            row: x,
            col: y,
            payload: Math.random() * 4
        })
    }
}

msg.rowdata.forEach( (row) => {
    row.forEach( (col) => {
        col.payload = col.val ? 3 : 0.25
        col.col += 1
        col.row += 1
        node.send(col)
    })
})
